description:
Billy's Nightmare is a fun, addictive and eye-candy game.
Your mission is to help Billy wake up from different bad dreams, all caused by endless hours of frantic gaming.

Test your memory skills and enjoy hours of this graphically-delight entertainment. For you and your children!

Although simple and easy-to-learn, Billy's Nightmare is not the typical repeat-the-sequence game, since it counts with different multi-touch and challenge features.

This HD version is totally Ads-free and count with 108 playable levels, plus some extra images for the ending.

